import { buttonComponentText } from "../../utils/arrays";
import ButtonComponent from "../ButtonComponent/ButtonComponent";
import Header from "../Header/Header";
import "./Initial.css";

export default function Initial() {
  return (
    <div className="initial">
      <Header />
      <div className="initial__block">
        <h4 className="initial__block-h4">
          Передовая IT-студия
        </h4>
        <h1 className="initial__block-h1 initial__text">
          FAST DIGITAL
        </h1>
        <span className="initial__block-span initial__text">
          Decisions
        </span>
        <ButtonComponent
          {...buttonComponentText[0]}
        />
      </div>
    </div>
  );
}
